  <div style={{ minHeight: '100vh', background: 'linear-gradient(120deg, #232526 0%, #414345 100%)', padding: 40 }}>
    <div style={{ display: 'flex', justifyContent: 'center' }}>
      <GlassmorphicToneGenerator />
    </div>
  </div>
);

export default App;
